// PERFECT PIXEL SCRIPT

let pPixel = document.querySelector('.pPixel');
if (pPixel) {
	pPixel.innerHTML += '<style>.pPixel__img{top:0;left:0;position:absolute;width:100%;transition-duration:.3s;pointer-events:none;display:block;z-index:1000;background-repeat:no-repeat;background-position:50% 0px;}.pPixel__img.hd{display:none;}.pPixel__img.inv{filter:invert(100%)}.pPixel__btn{position:fixed;z-index:1000;top:50%;width:60px;height:36px;line-height:30px;text-align:center;color:#fff;cursor:pointer;border:3px solid yellow}.pPixel__hide{border-radius:0 180px 180px 0;background:green;left:0}.pPixel__inv{border-radius:180px 0 0 180px;background: red;right:0}</style>';
	pPixel.innerHTML += '<div class="pPixel__btn pPixel__hide">hide</div><div class="pPixel__btn pPixel__inv">inv</div>';

	let pPixelImg = document.querySelector('.pPixel__img');
	let pPixelHide = document.querySelector('.pPixel__hide');
	let pPixelInv = document.querySelector('.pPixel__inv');

	if (pPixelImg || pPixelHide || pPixelInv) {

		let pPixSets = {
			opacity: pPixelImg.dataset.opacity,
			image: 'url("' + pPixelImg.dataset.img + '")',
			position: pPixelImg.dataset.position,
			imgHeight: pPixelImg.dataset.height
		}

		pPixelImg.style.opacity = pPixSets.opacity;
		pPixelImg.style.backgroundImage = pPixSets.image;
		pPixelImg.style.backgroundPosition = pPixSets.position;
		pPixelImg.style.height = pPixSets.imgHeight;


		function pPixelFn(el, mod) {
			el.addEventListener('click', () => {
				pPixelImg.classList.toggle(mod);
				console.log(mod);
			});
		}

		pPixelFn(pPixelHide, 'hd');
		pPixelFn(pPixelInv, 'inv');

	}
}

